private List<MediaStoreData> query(Uri contentUri,String[] projection,String sortByCol,String idCol,String dateTakenCol,String dateModifiedCol,String mimeTypeCol,String orientationCol,MediaStoreData.Type type){
  final List<MediaStoreData> data=new ArrayList<MediaStoreData>();
